import React, { useState, useEffect } from "react";
import { Button, Form, Select, Upload, Space } from "antd";
import { UploadOutlined } from "@ant-design/icons";
import Header from "../Common/Header/Header";
import NavHeader from "../Common/Header/NavHeader/NavHeader";
import styled from "styled-components";
import Layouts from "../Common/Layout";

const { Option } = Select;

const formItemLayout = {
  labelCol: {
    span: 6,
  },
  wrapperCol: {
    span: 14,
  },
};

const normFile = (e) => {
  console.log("Upload event:", e);
  if (Array.isArray(e)) {
    return e;
  }
  return e?.fileList;
};

const onFinish = (values) => {
  console.log("Received values of form: ", values);
};

export default function WritePost() {
  const [form] = Form.useForm();

  return (
    <>
      <Header />
      <NavHeader />
      <Layouts>
        <Container>
          <Body>
            <form>
              <Form
                form={form}
                name="validateOnly"
                layout="vertical"
                autoComplete="off"
                {...formItemLayout}
                onFinish={onFinish}
                initialValues={{
                  name: "",
                  age: "",
                  select: undefined,
                  upload: null,
                }}
                style={{
                  width: "100%",
                  margin: "0 auto",
                  textAlign: "center",
                  justifyContent: "center",
                  alignItems: "center",
                }}
              >
                <Form.Item
                  name="제목"
                  label="제목"
                  rules={[{ required: true, message: "제목을 작성해주세요." }]}
                  style={{
                    width: "100%",
                  }}
                >
                  <Input height="54px" fontSize="14px" />
                </Form.Item>
                <Form.Item
                  name="내용"
                  label="내용"
                  rules={[{ required: true, message: "내용을 작성해주세요." }]}
                >
                  <Input height="54px" fontSize="14px" type="text" />
                </Form.Item>
                <Form.Item
                  name="카테고리"
                  label="카테고리"
                  hasFeedback
                  rules={[
                    { required: true, message: "카테고리를 선택해주세요." },
                  ]}
                >
                  <Select placeholder="인공지능">
                    <Option value="AI">인공지능</Option>
                    <Option value="BACKEND">백엔드</Option>
                    <Option value="DEVOPS">데브옵스</Option>
                    <Option value="EMBEDDED">임베디드</Option>
                    <Option value="FRONTEND">프론트엔드</Option>
                    <Option value="GAME">게임</Option>
                  </Select>
                </Form.Item>

                <Form.Item
                  name="upload"
                  label="Upload"
                  valuePropName="fileList"
                  getValueFromEvent={normFile}
                  rules={[
                    { required: true, message: "이미지를 선택해주세요." },
                  ]}
                >
                  <Upload name="logo" action="/upload.do" listType="picture">
                    <Button icon={<UploadOutlined />}>Click to upload</Button>
                  </Upload>
                </Form.Item>

                <Form.Item wrapperCol={{ span: 12, offset: 6 }}>
                  <Space>
                    <Button type="primary" htmlType="submit">
                      Submit
                    </Button>
                    <Button htmlType="reset">reset</Button>
                  </Space>
                </Form.Item>
              </Form>
            </form>
          </Body>
        </Container>
      </Layouts>
    </>
  );
}

const MainWrap = styled.div`
  width: 1050px;
  margin: 0px auto;
  padding: 60px 0px;
  text-align: center;
  justify-content: center;
  align-items: center;
`;

const Container = styled.div`
  min-width: 1050px;
  margin-top: 90px;
  margin-bottom: 60px;
`;

const Body = styled.div`
  display: flex; /* 가운데 정렬을 위한 추가 */
  flex-direction: column; /* 세로 중앙 정렬을 위한 추가 */
  width: 100%;
  margin: 0px auto;
  letter-spacing: -0.6px;
`;

const Input = styled.input`
  height: ${(props) => props.height || "44px"};
  width: ${(props) => props.width || "100%"};
  padding: 0px 11px 1px 15px;
  border-radius: 4px;
  border: 1px solid rgb(221, 221, 221);
  font-weight: 400;
  font-size: ${(props) => props.fontSize || "16px"};
  line-height: 1.5;
  color: rgb(51, 51, 51);
  outline: none;
  box-sizing: border-box;

  &:focus {
    outline: 1px solid;
  }
`;
